			// })
			.then(data => {
				console.log(data.items[0]['snippet']['title'])
			}) 

	}
	render () {
		return (
			<div>
				<div> Test </div>
				<div> {this.state.youTubeVideos.items[0]['snippet']['title']} </div>
			</div>
		);
	}
}

export default Youtube;
